import React, { Component } from 'react';
import { withRouter } from 'react-router-dom'
import { WingBlank, WhiteSpace, Steps } from 'antd-mobile'
import './index.less'
import StepOne from './StepOne'
import StepTwo from './StepTwo'
import StepThree from './StepThree'


const Step = Steps.Step;

@withRouter
class Singup extends Component {
  state = {
    curStep: 0
  }
  renderCurStep = () => {
    switch (this.state.curStep) {
      case 0:
        return <StepOne />
      case 1:
        return <StepTwo />
      case 2:
        return <StepThree />
      default:
        break;
    }
  }

  render() {
    const { clientHeight } = this.props
    return (
      <div style={{height: clientHeight}} className="container">
        <WingBlank mode={20} className="stepsExample">
          <Steps current={0} direction="horizontal">
            {Array(3).map(() => <Step />)}
          </Steps>
          <WhiteSpace />
          {this.renderCurStep()}
        </WingBlank>
      </div>
    )
  }
}

export default Singup;
